/** @format */

import React from "react";
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";
import Comman from "./Comman";
// import Spiderman from "https://thapatechnical.github.io/reactlivewebsite/static/media/img2.e981619f.svg";
import Spiderman from "./imgs/spiderman.png";

const Home = () => {
  return (
    <>
      <Navbar />
      <Comman
        h1="Grow your business with"
        imgsrc="https://thapatechnical.github.io/reactlivewebsite/static/media/img2.e981619f.svg"
      />
      <Footer />
    </>
  );
};
export default Home;
